import React from "react";
import classes from './styles.module.css';

const Red = () => {
	return (
		<>
			<div className={classes.lighter} className={classes.red}></div>
			<div className={classes.lighter, classes.yellow}></div>
			<div className={classes.lighter, classes.green}></div>
		</>
	)
}

export default Red
